import SearchOptionUI from "../SearchOptionUI";
import style from "./SearchOptionCategory.module.css";

const categoryItem = [
  "food",
  "clothing",
  "housing",
  "transportation",
  "education",
  "entertainment",
  "salary",
  "stock",
];

const checkboxTime = [
  { text: "today", value: 0 },
  { text: "yesterady", value: 1 },
  { text: "three days ago", value: 3 },
  { text: "a week ago", value: 7 },
  { text: "a month ago", value: 30 },
  { text: "three months ago", value: 90 },
  { text: "a year ago", value: 100 },
];

function SearchOptionCategory() {
  return <SearchOptionUI label="category" checkboxItem={categoryItem} />;
}

export default SearchOptionCategory;
